					{
						"name": "Overview",
						"Notes": "<h3>Organic Rankine Cycle</h3>This model represents a simple system for recovering energy from fluid with a poor heat quality. That is they aren't very hot.\n\nA low boiling fluid is used to permit boiling and super heating at reasonable temperatures. The superheated gas is then reduced in pressure in a turbine, recovering energy. The low pressure gas is condensed, typically in an air cooler, and then pumped back up to pressure and introduced into the boiler.\n\nThe envelope plot and the lines representing the changes  in pressure and temperature at each stage is a valuable tool for trying to get the best result. The turbine line should always be in the vapour phase and the the pump line should always be in liquid region.\n\n<svg xmlns=\"http://www.w3.org/2000/svg\" style=\"background: #ffffff; background-color: #ffffff; color-scheme: light;\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" version=\"1.1\" width=\"416px\" height=\"325px\" viewBox=\"-0.5 -0.5 416 325\"><defs/><rect fill=\"#ffffff\" width=\"100%\" height=\"100%\" x=\"0\" y=\"0\" style=\"fill: rgb(255, 255, 255);\"/><g><g data-cell-id=\"0\"><g data-cell-id=\"1\"><g data-cell-id=\"7T0qLUJSZUNTfLDKKEMr-1\"><g><path d=\"M 57 87 L 80 27 L 134 27 L 157 87 Z\" fill=\"#ffffff\" stroke=\"#000000\" stroke-miterlimit=\"10\" transform=\"translate(107,0)scale(-1,1)translate(-107,0)rotate(-270,107,57)\" pointer-events=\"all\" style=\"fill: rgb(255, 255, 255); stroke: rgb(0, 0, 0);\"/></g></g><g data-cell-id=\"7T0qLUJSZUNTfLDKKEMr-2\"><g><rect x=\"257\" y=\"7\" width=\"80\" height=\"80\" fill=\"none\" stroke=\"none\" pointer-events=\"all\"/><ellipse cx=\"297\" cy=\"47\" rx=\"30\" ry=\"30\" fill=\"#ffffff\" stroke=\"#000000\" pointer-events=\"all\" style=\"fill: rgb(255, 255, 255); stroke: rgb(0, 0, 0);\"/><path d=\"M 267 47 L 277 47 L 287 32 L 307 62 L 317 47 L 327 47 M 337 7 L 257 87 M 327 11.5 L 337 7 L 332.5 17 L 332 12 Z\" fill=\"#ffffff\" stroke=\"#000000\" stroke-miterlimit=\"10\" pointer-events=\