				"Notes": "<h3>Idealized Steam Boiler Dynamics</h3>CoolProp has the ability to do flashes where one of the intensive properties is a density, but only for systems that contain a single compound.  In addition isenthalpic and isentropic flashes are much faster for single component systems since CoolProp handles these natively, while Math Minion adds a search mechanism to find a result for multicomponent systems.\n\nThis model demonstrates the use of a denisty-enthalpy flash for steam in a highly idealized dynamic simulation of a steam boiler. \n<svg width=\"100%\" height=\"100%\" viewBox=\"0 0 650 600\" version=\"1.1\" xmlns=\"http://www.w3.org/2000/svg\" xmlns:xlink=\"http://www.w3.org/1999/xlink\" xml:space=\"preserve\" xmlns:serif=\"http://www.serif.com/\" style=\"fill-rule:evenodd;clip-rule:evenodd;stroke-linecap:round;stroke-linejoin:round;stroke-miterlimit:1.5;\">\n\t\t\t\t<g id=\"Steam-Utilities\" serif:id=\"Steam Utilities\" transform=\"matrix(1,0,0,1,-0.382115,181.158)\">\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-1.40431,-71.8052)\">\n\t\t\t\t\t\t\t\t<rect x=\"435.787\" y=\"134.883\" width=\"168.38\" height=\"48.966\" style=\"fill:none;stroke:black;stroke-width:1px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,68.7328,-56.719)\">\n\t\t\t\t\t\t\t\t<text x=\"372.808px\" y=\"148.24px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Steam Utilities</text>\n\t\t\t\t\t\t</g>\n\t\t\t\t</g>\n\t\t\t\t<g id=\"Boiler-Heat\" serif:id=\"Boiler Heat\" transform=\"matrix(1,0,0,1,-181.493,216.618)\">\n\t\t\t\t\t\t<g transform=\"matrix(0.790654,0,0,1.49219,89.8258,-138.193)\">\n\t\t\t\t\t\t\t\t<rect x=\"435.787\" y=\"134.883\" width=\"168.38\" height=\"48.966\" style=\"fill:none;stroke:black;stroke-width:0.84px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,51.6906,-55.0826)\">\n\t\t\t\t\t\t\t\t<text x=\"410.806px\" y=\"148.24px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Heat to</tex