057,9.70665e-17,6.1375e-17,-1.0277,-126.837,314.878)\">\n\t\t\t\t\t\t\t\t<path d=\"M903.829,69.599L911.659,83.318L896.016,83.318L903.829,69.599Z\" style=\"fill:rgb(19,6,6);stroke:black;stroke-width:1.13px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(0.712057,9.70665e-17,6.1375e-17,-1.0277,-274.76,226.764)\">\n\t\t\t\t\t\t\t\t<path d=\"M903.829,69.599L911.659,83.318L896.016,83.318L903.829,69.599Z\" style=\"fill:rgb(9,0,255);stroke:rgb(6,0,255);stroke-width:1.13px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(0.712057,9.70665e-17,6.1375e-17,-1.0277,-315.175,351.046)\">\n\t\t\t\t\t\t\t\t<path d=\"M903.829,69.599L911.659,83.318L896.016,83.318L903.829,69.599Z\" style=\"fill:rgb(9,0,255);stroke:rgb(6,0,255);stroke-width:1.13px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(-0.712057,-9.86472e-18,6.44821e-17,1.0277,781.337,264.911)\">\n\t\t\t\t\t\t\t\t<path d=\"M903.829,69.599L911.659,83.318L896.016,83.318L903.829,69.599Z\" style=\"fill:rgb(19,6,6);stroke:black;stroke-width:1.13px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-1.55979,-62.8079)\">\n\t\t\t\t\t\t\t\t<path d=\"M340.424,149.972L435.671,150.337\" style=\"fill:none;stroke:black;stroke-width:1px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-1.55979,-62.8079)\">\n\t\t\t\t\t\t\t\t<path d=\"M521.167,175.156L518.242,306.639\" style=\"fill:none;stroke:black;stroke-width:1px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-1.55979,-62.8079)\">\n\t\t\t\t\t\t\t\t<path d=\"M519.748,356.105L519.748,516.466L430.91,516.466\" style=\"fill:none;stroke:black;stroke-width:1px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t</g>\n\t\t\t\t<g id=\"valve\" transform=\"matrix(0.34932,0,0,0.477322,198.56,86.677)\">\n\t\t\t\t\t\t<g transform=\"matrix(6.15827e-17,1,-1,6.15827e-17,447.186,-317.671)\">\n\t\t\t\t\t\t\t\t<path d=\"M318.772,105.125L347.185,160.635L290.359,160.635L318.772,105.125Z\" style=\"fill:none;stroke:black;stroke-width:2.39px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(6.0882e-17,-1,1,6.0882e-17,236.936,319.873)\">\n\t\t\t\t\t\t\t\t<path d=\"M318.772,105.125L347.185,160.635L290.359,160.635L318.772,105.125Z\" style=\"fill:none;stroke:black;stroke-width:2.39px;\"/>\n\t\t\t\t\t\t</g>\n\t\t\t\t</g>\n\t\t\t\t<g id=\"Labels\">\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-144.308,-161.008)\">\n\t\t\t\t\t\t\t\t<text x=\"441.033px\" y=\"708.584px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Condensate</text>\n\t\t\t\t\t\t\t\t<text x=\"474.402px\" y=\"733.369px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Pump</text>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,-92.792,-168.642)\">\n\t\t\t\t\t\t\t\t<text x=\"137.12px\" y=\"527.325px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Boiler</text>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,42.251,19.0035)\">\n\t\t\t\t\t\t\t\t<text x=\"173.196px\" y=\"18.355px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:30px;\">Dynamic Steam Boiler</text>\n\t\t\t\t\t\t</g>\n\t\t\t\t\t\t<g transform=\"matrix(1,0,0,1,66.6402,-52.0523)\">\n\t\t\t\t\t\t\t\t<text x=\"65.223px\" y=\"484.68px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Condensate</text>\n\t\t\t\t\t\t\t\t<text x=\"93.922px\" y=\"509.465px\" style=\"font-family:'ArialMT', 'Arial', sans-serif;font-size:24px;\">Return</text>\n\t\t\t\t\t\t</g>\n\t\t\t\t</g>\n</svg>\nSteam is raised in a boiler and accumulates in its steam chest, before flowing through a valve into a steam utilities header.  From there it is used in some sort of utilities, resulting in condensate, that is pumped back up to the boiler pressure and arbitrarily assumed to be 80 C. The condensate flow is assumed to be proportional to the holdup in the condensate tank, while a proportional integral controller regulates the heat flow to the boiler to meet a steam flow set point.\n\nThe model integrates four values, with the initial values set in expression <b>initialY</b>:\n\n\t<b>boiler holdup (95 kg)</b>\n\t<b>condensate holdup (50 kg)</b>\n\t<b>boiler energy (120,000 kJ)</b>\n\t<b>steam flow controller accumulated error (0 unitless)</b>\n\nThe <b>boilerFlash</b> uses the formula\n\n\t<b>boilerHoldup / water.mwt / SteamChest</b>\n\nTo determine the density of the steam in the steam chest. A dummy flash <b>water</b> is used merely to obtain the molecular weight of water, while the <b>SteamChest</b> expression specifies the volume of the steam chest as 3 m^3. This formula is entered, rather counterintuitively, in the <b>T or P</b> field, while the boiler energy holdup integrated by the <b>ode</b> tool and represented by the <b>boilerH</b> expression goes in the <b>2nd Prop</b> field.  The result is a density/enthalpy flash that determines the steam properties, including pressure.\n\nThe flow of steam through the valve to the steam header is calculated from a form of the <a href=\"https://en.wikipedia.org/wiki/Flow_coefficient\">flow coefficient equation</a>, using the pressure difference between the calculated boiler pressure and the specified steam header pressure of 700 kPa. \n\nThe valve is assumed to be isenthalpic and so the boiler vapour enthalpy can be used with the specified <b>utilityP</b> pressure to determine the steam header properties in flash <b>steamHeader</b>.\n\nThe properties of the condensate return to the boiler, that is after the pump, are calculated in flash <b>utilityCond</b> using the boiler pressure and the assumed 80 C temperature. The flow rate is a simple function of the condensate hold up:\n\n\t<b>ode.y.condHoldup * 1 \"1/min\"</b>\n\nWith these properties, the derivatives for <b>ode</b> can be calculated.\n\nThe derivitive for boiler mass holdup is simply the difference between the steam produced and the return condensate, which is calculated in expression <b>dBoilerMass</b> as:\n\n\t<b>utilityCond.massf - steamHeader.massf</b>\n\nSimilarly the condensate holdup derivative is just the negative of the above difference:\n\n\t<b>steamHeader.massf - utilityCond.massf</b>\n\nwhich is calculated in <b>dCondMass</b> for clarity, but just using <b>-dBoilerMass</b> would have been sufficient.\n\nA heat balance around the boiler provides the boiler energy derivative, by subtracting the steam header energy flow, again assuming the valve to be isentropic, from the supplied boiler heat plus the energy of the condensate return. This is done in expression <b>dBoilerEnergy</b>:\n\n\t<b>boilerHeat + utilityCond.hFlow - steamHeader.hflow</b>\n\nFinally the error signal for the flow controller calculation is taken as the difference between the desired flow, 3000 kg/h, and the actual flow divided by a scaling factor. This is done in <b>FlowSigError</b> as:\n\n\t<b>(3000 \"kg/h\" - steamFlow) / 6000 \"kg/h\"</b>\n\nThe error derivative for the integral portion of the controller is entered directly in the table of derivatives in <b>derivatives</b> as:\n\n\t<b>flowErrorSig / 1 s</b>\n\nThe resulting heat flow to the boiler is calculated from the controller formula:\n\n\t<b>5000 kw *\n\t\t\t{max 0, {min 1, FlowErrorSig * 3 +\n\t\t\tode.y.errorAccum * 0.2}}</b>\n\nwith the output signal using a proportionality constant of 3 and an integral constant of 0.2. The signal is constrained to the range 0 to 1 and multiplied by a heat flow of 5000 kw.\n\nThe <b>ode</b> tool records time, boiler holdup, boiler pressure, steam flow and condensate hold up and these are plotted in the <b>plots</b> with time on the x axis. Tap on the y axis in <b>plots</b> to cycle through the various lines. A static image is presented below:\n\n\t<b>Boiler Holdup 50 - 100 kg </b>\n\t<b>Condenser Holdup 45-55 kg</b>\n\t<b>Boiler Pressure 500 - 1500 kpa</b>\n\t<b>Steam Flow 0 - 8000 kg/h</b>",
