M102.521,349.617L195.911,349.479\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t\t\t<g transform=\"matrix(0.955649,-5.82201e-08,-5.82201e-08,0.943997,-206.466,100.488)\">\n\t\t\t\t\t\t\t<path d=\"M102.521,560.305L195.911,559.707\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t\t\t<g transform=\"matrix(-4.71665e-06,-0.943997,0.955649,-4.77487e-06,-619.507,961.863)\">\n\t\t\t\t\t\t\t<path d=\"M353.162,549.291L563.103,549.654\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t\t\t<g transform=\"matrix(-4.71665e-06,-0.943997,0.955649,-4.77487e-06,-619.507,961.863)\">\n\t\t\t\t\t\t\t<path d=\"M353.162,569.178L563.103,569.108\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t\t\t<g transform=\"matrix(-4.71665e-06,-0.943997,0.955649,-4.77487e-06,-619.507,961.863)\">\n\t\t\t\t\t\t\t<path d=\"M353.162,589.243L563.103,589.89\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t\t\t<g transform=\"matrix(-4.71665e-06,-0.943997,0.955649,-4.77487e-06,-619.507,961.863)\">\n\t\t\t\t\t\t\t<path d=\"M353.162,609.725L563.103,609.624\" style=\"fill:none;stroke:black;stroke-width:1.33px;\"/>\n\t\t\t\t\t</g>\n\t\t\t</g>\n\t\t\t<g transform=\"matrix(-0.943997,-1.15606e-16,1.17033e-16,-0.955649,696.47,530.824)\">\n\t\t\t\t\t<g id=\"HPTurbine\">\n\t\t\t\t\t\t\t<path d=\"M303.232,196.136L303.232,401.492L398.208,340.215L398.208,259.875L303.232,196.136Z\" style=\"fill:none;stroke:black;stroke-width:1.05px;\"/>\n\t\t\t\t\t</g>\n\t\t\t</g>\n</svg>\n\nHigh pressure steam is produced in boiler utilizing the energy of some sort of combustion, solar heating or nuclear reaction. A portion of this (<b>HPTInlet</b>) is sent to a high pressure turbine and is expanded to an intermediate pressure and of course generates power.\n\nA second portion of the high pressure steam (<b>RHHotIn</b>) is used in a reheater to raise the temperature of the vapour portion of the high pressure turbine exhaust to 250 C. This reheated steam (<b>MSTInlet</b>) is fed to the main turbine (<b>MainTurbine</b>) and the exhaust is condensed with ambient air to 40 degC, resulting in a very low pressure.\n\nThe condensate is then pumped back up to the high pressure and mixed with the steam from the heating side of the reheater and the liquids formed in the high pressure turbine to become the boiler feed. \n\nThis is a gross simplification for not only did I ignore all pressure drops, but a real system would probably have a complicated systems of feed heaters utilizing steam draws from intermediate parts of the turbine. I omitted these for simplicity and because in truth I really have no idea how they are implemented. &#128512;<h4>Calculations</h4>It is a pretty straight forward process, but there are some interesting heat balances used to get flows etc.\n\nThe feed to the high pressure turbine is represented by <b>HPTInlet</b> and it is specified with arbitrary T and P values of 300 degC and 6000 mPa, which were inspired by some random Internet browsing. I will come back to how the flow is calculated in a bit.\n\nThe high pressure turbine, <b>HPTurbine</b> lets the pressure down to 1000 mPa and then reheats the vapour portion of the exhaust to 250 degC to become the feed, <b>MSTInlet</b> to the main steam turbine <b>MainTurbine</b>.\n\nThe calculation of the flow for <b>MSTInlet</b> is a bit tricky and I had to dust off some rusty but fortunately basic algebra skills to come up with the formula. I assume that we know how much power we want to generate and want to back calculate the flows from that. This would be a simple heat balance if it weren't for the liquid being removed from the high pressure turbine outlet, with only the vapour going to <b>MSTInlet</b>.\n\nThe energy generated will be the sum of the high pressure and main turbines and is described by:</p>\n\n\t<b>E = (Hoh - Hih)Hf + (Moh - Mih)MF</b>\n\nwhere:\n\n\t<b>E</b> = the desired power produced - I assumed a princely 1000 mW, divided by a 0.95 efficiency for the generator.</li>\n\t<b>Hoh</b> = the enthalpy of the outlet of the high pressure turbine (<b>HPTurbine.h</b>)\n\t<b>Hih</b> = the enthalpy of the inlet of the high pressure turbine (<b>HPTInlet.h</b>\n\t<b>Hf</b> = the flow rate to the high pressure turbine (<b>HPTInlet.f</b>)\n\t<b>Moh</b> = the enthalpy of the outlet of the main turbine (<b>MainTurbine.h</b>)\n\t<b>Mih</b> = the enthalpy of the inlet to the main turbine (<b>MSTInlet.h</b>)\n\t<b>MF</b> = the flow rate to the main turbine, which will be Hf minus the liquid produced in the turbine.  This is what we want to solve for.\n\nThe expander models will calculate the outlet enthalpy even if the flow rates aren't known, so the only unknowns are the two feeds, and:\n\n\t<b>Mf = Hf * Hoq</b>\n\nwhere <b>Hoq</b> is the vapour fraction of the high pressure turbine outlet fluid (<b>HPTurbine.outfluid.q</b>). Combining and rearranging gives:\n\n\t<b>E*Hq / (Hoh - Hin + (Moh - Mih)Hq)</b>\n\nor in Minionese:\n\n\t<b>HPTurbine.outfluid.q * 1000 mw\n\t/\n\t(\n\t\t(\n\t\t\tHPTInlet.h - HPTurbine.h  \n\t\t\t+ (MSTInlet.h - MainTurbine.h)\n\t\t\t* HPTurbine.outfluid.q\n\t\t)  * .95\n\t)</b>\n\nGoing back to the flow of <b>HPTInlet</b>, it is <b>Mf/Hq</b> or\n\n\t<b>MSTInlet.f / HPTurbine.outfluid.q</b>\n\nThe hot side feed to the reheater is represented by <b>RHHotIn</b>, which has all the same properties as <b>HPTInlet</b> except for the flow rate, which is determined by another, but simpler, heat balance. The duty of the reheater will simply be the heat flow of the cold side outlet (<b>MSTInlet.hflow</b>) minus that of the inlet (<b>HPTurbine.outfluid.v.hflow</b>).\n\nThe flow rate of the hot side will then be that duty divided by the difference in hot side outlet and inlet enthalpies.\n\nA compressor model is pressed into service as the condensate pump <b>CondPump</b> (the thermodynamics doesn't care) and a three feed mixer model <b>CondMixer</b> combines the pumped condensate, the reheater hot side outlet and the liquids from the high pressure turbine into the boiler feed <b>BoilerInlet</b>. \n\nFinally an expression <b>OverallBalance</b> is added that does a material balance around the entire system. This should equate to near zero or something isn't right. As it come up with a tiny fraction of a watt, it is more than close enough.",
